import{_ as a,o,c as r,z as e,a as t}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 2.2-1821 Deposits to be to credit of State Treasurer; how money withdrawn.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/2.2-1821.md","filePath":"vacode/2.2-1821.md"}'),s={name:"vacode/2.2-1821.md"},n=e("h1",{id:"§-2-2-1821-deposits-to-be-to-credit-of-state-treasurer-how-money-withdrawn",tabindex:"-1"},[t("§ 2.2-1821 Deposits to be to credit of State Treasurer; how money withdrawn. "),e("a",{class:"header-anchor",href:"#§-2-2-1821-deposits-to-be-to-credit-of-state-treasurer-how-money-withdrawn","aria-label":'Permalink to "§ 2.2-1821 Deposits to be to credit of State Treasurer; how money withdrawn."'},"​")],-1),i=e("p",null,"All state moneys in a state depository shall stand on the books of such depository to the credit of the State Treasurer. The State Treasurer shall have authority to draw any of the money by his check, by electronic funds transfer, or by any means deemed appropriate and sound by the State Treasurer and approved by the Governor, drawn upon a warrant issued by the Comptroller. If any money to his credit shall be knowingly paid otherwise than upon his check, electronic funds transfer or by alternative means specifically approved by the State Treasurer and the Governor, drawn upon such warrant, the payment shall not be valid against the Commonwealth.",-1),d=e("p",null,[t("Code 1950, § 2-201; 1966, c. 677, § 2.1-226; 1974, c. 231; 1984, c. 374; 2001, c. "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0844",target:"_blank",rel:"noreferrer"},"844"),t(".")],-1),h=[n,i,d];function c(l,p,u,f,m,y){return o(),r("div",null,h)}const b=a(s,[["render",c]]);export{_ as __pageData,b as default};
